    National Wildlife Refuge describes how forest management techniques will be used
    to fulfill refuge objectives.  Two types of forest management concepts will be used:
    regulated management and public-use management.  The wildlife that will receive
    the most benefits from forest management practices are: white-tailed deer, sambur
